         <Navbar.Brand href="#"></Navbar.Brand>
         <Navbar.Brand href="#">Home</Navbar.Brand>
         <Navbar.Brand href="#">About</Navbar.Brand>
         <button>sign-in </button>
         <button>sign-up </button>

         </Navbar>





    </div>
  )

}

export default Nav;
